@keyframes caretBlink {
    from { opacity: 1.0; }

    from {
        transform:rotate(0deg);
    }
    to {
        transform:rotate(360deg);
    }
}

    animation-name: caretBlink;

    animation-duration: 1s;

}

#en-markup-loading-spinner img {

    top: 0px;

}
